    <script>
      var stack = new Stack();
      var queue = new Queue();
      var runCount = 1000;

      for(var i=0; i<runCount; i++){
        var stack = new Stack();
        console.log(stack);
      }

      for(var i=0; i<runCount; i++){
        stack.push(i);
      }

      for(var i=0; i<runCount; i++){
        stack.pop();
      }

      for(var i=0; i<runCount; i++){
        var queue = new Queue();
      }

      for(var i=0; i<runCount; i++){
        queue.enqueue(i);
      }

      for(var i=0; i<runCount; i++){
        queue.dequeue();
      }

      console.log(stack.size());
      console.log(queue.size());
      console.log("done");
    </script>
